### 思路
将数字转化为一个数组;之后将两个数组进行逐位相加.

### 代码

```js
/**
 * @param {number[]} num
 * @param {number} k
 * @return {number[]}
 */
var addToArrayForm = function(num, k) {
    let len = num.length;
    let kSplitArr = String(k).split("").map(item => Number(item));
    let kSplitLen = kSplitArr.length;
    if(len < kSplitLen) {
        let temp = num;
        num = kSplitArr;
        kSplitArr = temp;
    }

    // 逐位相加
    let flag = 0;
    len = num.length - 1;
    while(kSplitArr.length || flag) {
        let kVal = kSplitArr.pop();
        let val;
        if(kVal >= 0) {
            val = num[len] + kVal + flag;
        } else {
            val = num[len] + flag;
        }
        flag = Math.floor(val / 10);
        num[len] = val % 10;
        if(flag && len - 1 < 0) {
           num.unshift(flag)
        }
        len--;
    }
    // console.log(num)
    return num;
};
```

**复杂度分析**
- 时间复杂度：O(N)，其中 N 为数组长度。
- 空间复杂度：O(1)
